"use strict";

const { Deque } = require('collections/deque');

function f_gold(arr, start) {
    const n = arr.length;
    const q = new Deque([start]);
    while (q.length) {
        const i = q.shift();
        if (arr[i] === 0) {
            return true;
        }
        for (const j of [i + arr[i], i - arr[i]]) {
            if (0 <= j && j < n && arr[j] >= 0) {
                q.push(j);
            }
        }
        arr[i] = -1;
    }
    return false;
}
